import React from 'react';
import styles from './paginator.module.css'




const Paginator = ({totalUsersCout, pageSize, currentPage, onPageChanged}) => {

    let pageCount = Math.ceil(totalUsersCout / pageSize);
    let pages = [];
    for (let i = 1; i <= pageCount; i++) {
        pages.push(i);
    }
    debugger;
    return <div>
        <div>
            {pages.map(p => {
                return <span className={currentPage === p && styles.selectedPage}
                    onClick={(e) => {
                        onPageChanged(p)
                    }
                    }
                >{p}</span>

            })}
        </div>
    </div>
}

export default Paginator;
